            return filteredLogs;
        }

        // lọc các log mà log.details chứa toàn bộ details truyền vào
        return filteredLogs.filter(log =>
            details.every(d => {
                const result = Array.isArray(log.details) && log.details.includes(d);
                console.log('Check detail:', d, result, log.details);
                return result;
            })
        );
    };

    count = ($table) => {
