            if (!html)
                return [];
            let $html = $(html);
            let logs = $html.find('.history .updates_timeline > li').map((i, el) => {
                let $el = $(el);
                // lấy action
                let $header = $el.find('.updateHeaderInfoText');
                let action = $header.text().replace(/\s+/g, ' ').trim();
                // nếu cùng 1 el có cả 2 class -> bỏ qua details
